import React, { useRef, useCallback } from 'react';
import { Hole } from '../Hole/Hole';
import styles from './GameBoard.module.css';

const CANVAS_SIZE = 600;
const SIZE = 4;
const CELL = CANVAS_SIZE / SIZE;
const OFFSET = 30;

export function GameBoard({
  mode,
  gridToDraw,
  animating,
  onHoleClick,
  onCanvasClick,
  mouseMarkerRef,
  holeRefs,
  canvasRef
}) {
  const boardWrapperRef = useRef(null);

  // Create holes array
  const holes = [];
  let n = 1;
  // Top row
  for (let c = 0; c < SIZE; c++) {
    holes.push({ num: n++, x: c * CELL + CELL / 2, y: -OFFSET });
  }
  // Right column
  for (let r = 0; r < SIZE; r++) {
    holes.push({ num: n++, x: CANVAS_SIZE + OFFSET, y: r * CELL + CELL / 2 });
  }
  // Bottom row
  for (let c = SIZE - 1; c >= 0; c--) {
    holes.push({ num: n++, x: c * CELL + CELL / 2, y: CANVAS_SIZE + OFFSET });
  }
  // Left column
  for (let r = SIZE - 1; r >= 0; r--) {
    holes.push({ num: n++, x: -OFFSET, y: r * CELL + CELL / 2 });
  }

  const handleCanvasClick = useCallback((e) => {
    if (mode !== 'inference' || animating || !canvasRef.current) return;
    const rect = canvasRef.current.getBoundingClientRect();
    const x = e.clientX - rect.left;
    const y = e.clientY - rect.top;
    const c = Math.floor(x / CELL);
    const r = Math.floor(y / CELL);
    if (r < 0 || r >= SIZE || c < 0 || c >= SIZE) return;
    onCanvasClick(r, c);
  }, [mode, animating, onCanvasClick, canvasRef]);

  return (
    <div className={styles.leftColumn}>
      <div ref={boardWrapperRef} className={styles.boardWrapper}>
        <canvas
          ref={canvasRef}
          width={CANVAS_SIZE}
          height={CANVAS_SIZE}
          onClick={handleCanvasClick}
        />
        {holes.map((hole, index) => (
          <div key={hole.num}>
            <Hole
              number={hole.num}
              x={hole.x}
              y={hole.y}
              onClick={onHoleClick}
              animating={animating}
              ref={el => { if (holeRefs && el) holeRefs.current[index] = el; }}
            />
          </div>
        ))}
        <svg
          ref={mouseMarkerRef}
          className={styles.mouseMarker}
          viewBox="0 0 24 24"
          width="72"
          height="72"
        >
          {/* Mouse body - side profile facing right */}
          <ellipse cx="14" cy="14" rx="6" ry="5" fill="#d3d3d3" stroke="#999" strokeWidth="0.5" />
          {/* Mouse head - side profile */}
          <ellipse cx="8" cy="12" rx="5" ry="6" fill="#d3d3d3" stroke="#999" strokeWidth="0.5" />
          {/* Single visible ear */}
          <ellipse cx="6" cy="7" rx="3" ry="3.5" fill="#d3d3d3" stroke="#999" strokeWidth="0.5" />
          {/* Eye - side view */}
          <circle cx="9" cy="11" r="1.5" fill="#000" />
          {/* Nose - small black dot */}
          <circle cx="3" cy="12" r="0.8" fill="#000" />
          {/* Whiskers */}
          <line x1="3" y1="11" x2="0" y2="10" stroke="#000" strokeWidth="0.5" strokeLinecap="round" />
          <line x1="3" y1="12" x2="0" y2="12" stroke="#000" strokeWidth="0.5" strokeLinecap="round" />
          <line x1="3" y1="13" x2="0" y2="14" stroke="#000" strokeWidth="0.5" strokeLinecap="round" />
        </svg>
      </div>
    </div>
  );
}
